import BreedCard from "../BreedCard/BreedCard";
import "./Breeds.modules.css"

const Breeds = (breeds) => {

  if (breeds.length === 0 ) {
    return <p className="cardsBox">No hay razas para mostrar</p>
  }


  return (
    <>
      <div className="cardsBox">
        {breeds.map((breed) => (
            <BreedCard
              key={breed.id}
              id={breed.id}
              name={breed.name}
              img={breed.image.url}
              temperament={breed.temperament}
              weight={breed.weight}
            />
        ))}
      </div>
    </>
  );
};

export default Breeds;
